import './App.css';
import Navbar from './component/Navbar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <h1 className="text-3xl font-bold text-center underline">Hello world!</h1>
      <h1 className=" bg-gradient-to-r from-green-300 to-pink-400 via-blue-300">
        Hello world!
      </h1>
    </div>
  );
}

export default App;
